    false,nt"url": null,nt"notes": "NCEI Accession 0155744 includes physical
    and underway data collected aboard the ROGER REVELLE during cruise KNOX10RR in the
    Arabian Sea and Indian Ocean from 2007-10-22 to 2007-11-04. These data include CURRENT
    SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The
    instruments used to collect these data include ADCP and GPS. These data were collected
    by Christopher Charles of University of California - San Diego; Scripps Institution
    of Oceanography as part of Surveying and sampling the submerged coral reefs of the
    west/central Indian Ocean: the sea level and climate history of the last 20,000
    years. The Lamont-Doherty Earth Observatory (LDEO) submitted these data to NCEI
    as part of the NSF sponsored Rolling Deck to Repository (R2R) program.nnThe ADCP
    data represent the raw and automated processed data set. Post processed quality
    assessed data are not available in this accession.",nt"license_title": null,nt"extras":
